void UI::set_current_year(const int year) {
	bool set = false;
	
	for (auto& each : years) {
		if (each.year == year) {
			current_year = &each;
			set = true;
		}
	}

	if (!current_year || !set) {
		cn::Year temp_current_year = generate_calendar(year);

		years.push_back(temp_current_year);

		current_year = &years.back();
	}
}

