//================================================================================================================================

//Public:
void UI::application_loop() {

	deserialize(years);
	
	auto[year, month, day] = get_current_date();
	current_date = {year, month, day };

	set_current_year(year);

	set_drawables();

	std::thread clock([&]() {
		while (cn::APPLICATION_STATE == START_MENU) {
			auto[hour, minute, second] = get_current_time();
			std::string minutes;
			if (minute < 10) {
				minutes.append("0" + std::to_string(minute));
			}
			else {
				minutes.append(std::to_string(minute));
			}
			
			std::string seconds;
			if (second < 10) {
				seconds.append("0" + std::to_string(second));
			}
			else {
				seconds.append(std::to_string(second));
			}
			
			std::string time = std::to_string(hour) + ":" + minutes + ":" + seconds;
			start_menu_time->text.setString(time);
		}
	});

	
	bool open = true;
	while (open) {
		switch (cn::APPLICATION_STATE) {
			case START_MENU: {
				loop_selector = true;
				start_menu_loop();
				break;
			}
			case DAY_SELECTION_MENU: {
				loop_selector = true;
				day_selection_menu_loop();
				break;
			}
			case INDIVIDUAL_DAY_MENU: {
				loop_selector = true;
				individual_day_loop();
				break;
			}
			case EXIT: {
				serialize(years);
				open = false;
				break;
			}
		}
	}

	clock.join();
}

